import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='Pokedex'>
        <div className='Pokecard'>
          <h1 className='Pokecard-name'>Name</h1>
          <img className='Pokecard-img'/>
          <p className='Pokecard-type'>Type: type</p>
          <p className='Pokecard-exp'>EXP: exp</p>
        </div>
      </div>
    </div>
  );
}

export default App;
